import React, {Component} from "react";

class ServerList extends Component {

    createList() {
        fetch('http://playground.tesonet.lt/v1/servers', {
            method: 'GET',
            headers: {
                'Accept': 'application/json',
                'Content-Type': 'application/json',
            }
        });
        let servers: any[] = [
            {}
        ];
    }

    render() {
        return (
            <div>
                List
                {this.createList()}
            </div>
        );
    }
}

export default ServerList;
